import React, { useEffect } from "react"
import './index.css'
function Prodact(){
    const [prodact,setprodact]=React.useState([])
    useEffect(()=>{
        fetch('https://fakestoreapi.com/products')
        .then((res)=>res.json())
        .then((data)=>setprodact(data))
    },[])
const arr=prodact.map((el)=>
<div className="CardList">
<img src={el.image} alt="" />
<h3>{el.category}</h3>
<p>{el.description}</p>
<h4>{el.price}</h4>

</div>

)
    return(
<div className="List">
  {arr}
</div>
   




    )
    }
export default Prodact
